import classes from './MealsSummary.module.css';

const MealsSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Delicious Food, Free for you</h2>
      <p>
        Stay connecte with this app to notify
      </p>
      <p>
        You will get the free meals with delicious taste!
      </p>
    </section>
  );
};

export default MealsSummary;
